#MANUAL SPARQL
#MANUAL ANSWERS because this query times out for us
PREFIX ns: <http://rdf.freebase.com/ns/>
SELECT DISTINCT  ?x
WHERE {
  {
    SELECT ?x (MAX(?yr) AS ?recent_yr)
    WHERE {
      ns:m.09c7w0 ns:location.location.contains ?x . # United States
      ?x ns:common.topic.notable_types ns:m.01m9 . # City/Town/Village
      ?x ns:location.statistical_region.population ?y .
      ?y ns:measurement_unit.dated_integer.number ?p .
      ?y ns:measurement_unit.dated_integer.year ?yr .
    }
    GROUP BY ?x 
  }
  {
    SELECT ?x ?p ?yr
    WHERE {
      ns:m.09c7w0 ns:location.location.contains ?x . # United States
      ?x ns:common.topic.notable_types ns:m.01m9 . # City/Town/Village
      ?x ns:location.statistical_region.population ?y .
      ?y ns:measurement_unit.dated_integer.number ?p .
      ?y ns:measurement_unit.dated_integer.year ?yr .
    }
  }
  FILTER (?yr = ?recent_yr)
}
ORDER BY DESC(xsd:integer(?p))
LIMIT 1
